import parque1g from '../../assets/images/parque1g.png';
import parque2g from '../../assets/images/parque2g.png';
import parque3g from '../../assets/images/parque3g.png';
import parque4g from '../../assets/images/parque4g.png';
export default function Presentacion() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-sm">
          <p className="">Hola</p>
          <p className="">Soy Eliana Murillo</p>
          <p className="">UX/UI Desig Researcher </p>
          <p className="">Graphic Designer</p>
          <p className="">Front End Developer</p>
          <p className=""></p>
          <p className="">
            UX Design Researcher especialista en investigación cualitativa y cuantitativa y UX/UI
            para el rediseño de plataformas. Diseñadora gráfica experta en creación de imágenes
            digitales. Fron end developer con experiencia en React para la implementación de
            interfaces interactivas.
          </p>
        </div>
        <div className="col-sm"></div>
      </div>
    </div>
    
  );
}
